/* 使い方*/
var mst_obj=[];var mst_toggle=false;
/* ↑これをできるだけ上の方へ貼り付けてください*/
/* 次に*/
function setTimeout(a,b){mst_toggle=!0;mst_obj.push({time:b/50,cb:a})}function mst_roop(){if(mst_toggle)for(var a=0;a<mst_obj.length;a++){var b=mst_obj[a],c=b.time;c--;0>=c?(eval(b.cb),mst_obj.splice(a,1)):mst_obj[a].time=c}};
/* これを一番下に貼り付けてください*/
/* そして*/
mst_roop();
/* を function modTick()の中に貼り付けてください */
